import { Typography } from "antd";
import './Homepage.css'

function HomePage(){
    return(
        <div className="homepage">
            <Typography.Title level={4}>Home</Typography.Title>

        </div>
    )

}
function Homedata(){
    return(
        <div>
            <h1>Welcome To My WebApp...</h1>
        </div>
    )

}
export default {HomePage,Homedata};
